import React from "react";
import ReactDOM from "react-dom";

export const CustomComponent = (editor, { text, start, end, speed }) => {
  const el = document.createElement("div");
  el.innerHTML = text;
  const component = (
    <CounterNumber start={start} end={end} speed={speed} />
  );
  ReactDOM.render(component, el);

  return el;
};
